import React from "react";
import "./style.css";

const user = {
	name: "Chris on Code",
	location: "Las Vegas",
	foodType: "Everything",
	age: 28,
	likes: "Coding into the wee hours of the morning",
	twitterUsername: "chrisoncode",
	avatar:
		"https://scotch-res.cloudinary.com/image/upload/v1556479698/xRZsnhr0_400x400_cpyg2t.png",
};

function App() {
	return <div className="App">
		<img src={user.avatar} />
		<h1>{user.name}</h1>
		<p>{user.location}</p>
		<p>{user.foodType}</p>
		<p>{user.age}</p>
		<p>{user.likes}</p>
		<p>{user.foodType}</p>
	</div>;
}

export default App;
